import React, { Component } from "react";
import Button from "./ui-elements/button"

class HeaderPanel extends Component {
    render() {
        return (
            <Button text="Header" onClick={() => {
                console.log("hola at ya!!");
            }}
            />
        );
    }
}

export default HeaderPanel
